import React from 'react'
import styled from 'styled-components'

const Regional = ({CountryName}) => {
    return (
      <RegionContainer>
          <div className="Regional-tab">

          </div>
          <div className="Blob">
            <svg viewBox="0 0 200 200" xmlns="http://www.w3.org/2000/svg">
            <path fill="#8A3FFC" d="M46.2,-62.3C56.3,-56.1,58.7,-38,64.4,-20.8C70,-3.7,79,12.4,78.4,29C77.9,45.5,67.8,62.5,53.1,66.8C38.5,71,19.2,62.6,1.7,60.2C-15.9,57.9,-31.7,61.7,-41.2,55.8C-50.6,49.8,-53.7,34.1,-58.7,19C-63.8,3.8,-70.8,-10.7,-67.7,-22.5C-64.6,-34.3,-51.3,-43.3,-38.3,-48.5C-25.3,-53.8,-12.6,-55.4,2.7,-59.1C18,-62.7,36,-68.5,46.2,-62.3Z" transform="translate(100 100)" />
            </svg>
          </div>
          <div className="Donut-Graph">

          </div>
      </RegionContainer>
    )
}

export default Regional

const RegionContainer = styled.div`
display : grid;
width:100%;
height : 100%;
grid-template-rows: 3fr 2fr;
grid-auto-columns:1fr 1fr;
grid-gap : 0.5rem;
justify-content : space-space-around;
& > div
{
    border-radius : 0.5rem;
    padding : 20px;
}
.Blob{
    background:pink;
    grid-row : 2/3;
    grid-column : 1/2;
    width: 100%;
    height:100%;
    position : relative;
}
.Donut-Graph{
    background : whitesmoke;
    grid-row : 2/3;
    grid-column : 2/3;
    width: 100%;
    height:100%;
}
.Regional-tab{
    background : purple;
    grid-row : 1/2;
    grid-column : 1/3;
    width: 100%;
    height:100%;
}`
